import React from "react";
import ReactDOM from "react-dom/client";
import { Routes, Route, BrowserRouter } from "react-router-dom";
import "./index.css";
import App from "./App";
import ClassAsgmts from "./components/classAsgmts";
import reportWebVitals from "./reportWebVitals";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />} />
        <Route
          path="/class-asgmts"
          element={
            <ClassAsgmts
              className={"Test Class"}
              asgmts={[
                { name: "Assignment 1", terms: [] },
                { name: "Assignment 2", terms: [] },
                { name: "Assignment 3", terms: [] },
                { name: "Assignment 4", terms: [] },
                { name: "Assignment 5", terms: [] },
                { name: "Assignment 6", terms: [] },
                { name: "Assignment 7", terms: [] },
              ]}
            />
          }
        />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);

reportWebVitals();
